control.onControlLoad:
//鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 9; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 9; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }
    g5.userId = parseInt(g5.dataset1.getData(2, sender.rowIndex));
    g5.userName = g5.dataset1.getData(0, sender.rowIndex);
    g5.nickName = g5.dataset1.getData(1, sender.rowIndex);
    g5.mobile = g5.dataset1.getData(5, sender.rowIndex);
    g5.note = g5.dataset1.getData(8, sender.rowIndex);
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
ee.setText(ee.getControl("panel10"), "0");
ee.setEditText(ee.getControl("edit2"), "");
ee.setEditText(ee.getControl("edit4"), "");
ee.setEditText(ee.getControl("edit5"), "");
ee.setEditText(ee.getControl("edit6"), "");
ee.setEditText(ee.getControl("edit7"), "");
ee.setEditText(ee.getControl("edit8"), "");
ee.setEditText(ee.getControl("edit1"), "");

g5.operation = "new";
ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.userId) || isNaN(g5.userId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
ee.setText(ee.getControl("panel10"), g5.userId);
ee.setEditText(ee.getControl("edit2"), g5.userName);
ee.setEditText(ee.getControl("edit4"), "");
ee.setEditText(ee.getControl("edit5"), "");
ee.setEditText(ee.getControl("edit6"), g5.nickName);
ee.setEditText(ee.getControl("edit7"), g5.mobile);
ee.setEditText(ee.getControl("edit8"), "");
ee.setEditText(ee.getControl("edit1"), g5.note);

g5.operation = "edit";
ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.userId) || isNaN(g5.userId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

control.onUpdate:
ee.setText(sender, text);
if (text == "") {
    var rowCount;
    if (eb.isEmpty(g5.dataset1)) {
        rowCount = 0;
    } else {
        rowCount = g5.dataset1.rowCount;
    } 
    if (sender.rowIndex < rowCount) {
        ee.setText(sender, "超级用户");
    }
}

if (text == "IDL") {
    ee.setText(sender, "正常");
} else if (text == "DIS") {
    ee.setText(sender, "禁用");
} else if (text == "DEL") {
    ee.setText(sender, "删除");
} else {
    ee.setText(sender, text);
}

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(dbo.userInfo.userName like '%" + db.encode(searchText) + "%') or " +
        "(dbo.userInfo.mobile like '%" + db.encode(searchText) + "%') or " +
        "(dbo.userInfo.nickName like '%" + db.encode(searchText) + "%') or " +
        "(dbo.userInfo.note like '%" + db.encode(searchText) + "%') or " +
        "(dbo.company.displayName like '%" + db.encode(searchText) + "%')) ";
}
if (companyId >=0) { //只能看自己公司的账户
    condition += " and (dbo.userInfo.companyId = " + companyId + ") ";
}
sql =
    "SELECT count(*) as c " +
    "FROM dbo.userInfo LEFT OUTER JOIN " +
    "      dbo.company ON dbo.userInfo.companyId = dbo.company.id " +
    "WHERE (dbo.userInfo.status <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT dbo.userInfo.id, dbo.userInfo.status, dbo.userInfo.companyId, " +
    "      dbo.userInfo.regDatetime, dbo.userInfo.lastAccessTime, dbo.userInfo.userName, " + 
    "      dbo.userInfo.password, dbo.userInfo.mobile, dbo.userInfo.nickName, " + 
    "      dbo.userInfo.note, dbo.company.displayName AS companyName " +
    "FROM dbo.userInfo LEFT OUTER JOIN " +
    "      dbo.company ON dbo.userInfo.companyId = dbo.company.id " +
    "WHERE (dbo.userInfo.status <> 'DEL') " + condition +
    "ORDER BY dbo.userInfo.regDatetime DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"userName,nickName,id,companyName,status,mobile,regDatetime,lastAccessTime,note", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
if (eio.readString8() != "T") {
    alert("无法获取您需要的数据：" + eio.readString8());
